import React, { useState, useEffect } from "react";
import API from "../../API/api";

export default function CPA() {
  const [employees, setEmployees] = useState([]);
  const [dates, setDates] = useState([]);

  useEffect(() => {
    const fetchEmployees = async () => {
      const token = localStorage.getItem("token");
      const res = await API.get("/employee/employeeList", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setEmployees(res.data);
    };
    fetchEmployees();
  }, []);

  useEffect(() => {
    const start = new Date("2025-08-01");
    const end = new Date("2025-08-30");
    const arr = [];
    let current = new Date(start);
    while (current <= end) {
      arr.push(new Date(current));
      current.setDate(current.getDate() + 1);
    }
    setDates(arr);
  }, []);

  const chunk = (arr, size) => {
    const chunks = [];
    for (let i = 0; i < arr.length; i += size)
      chunks.push(arr.slice(i, i + size));
    return chunks;
  };

  const dateChunks = chunk(dates, 15);

  return (
    <div className="p-6 max-w-full overflow-auto">
      <h2 className="text-3xl font-bold mb-6 text-center text-gray-800">
        CPA Report
      </h2>
      <div className="overflow-x-auto">
        {dateChunks.map((chunkDates, idx) => (
          <table key={idx} className="min-w-max w-full border-collapse mb-6">
            <thead className="sticky top-0 bg-gray-100 z-10">
              <tr>
                <th
                  rowSpan={3}
                  className="border px-3 py-2 bg-gray-200 text-left text-sm font-semibold"
                >
                  Name
                </th>
                <th
                  rowSpan={3}
                  className="border px-3 py-2 bg-gray-200 text-left text-sm font-semibold"
                >
                  Hourly Pay
                </th>
                {chunkDates.map((date) => (
                  <th
                    key={date}
                    colSpan={4}
                    className="border px-3 py-2 bg-gray-50 text-center text-sm font-semibold"
                  >
                    {date.getMonth() + 1}/{date.getDate()}
                  </th>
                ))}
              </tr>
              <tr>
                {chunkDates.map((date) => (
                  <React.Fragment key={date}>
                    <th
                      colSpan={2}
                      className="border px-2 py-1 bg-gray-50 text-center text-xs font-medium"
                    >
                      AM
                    </th>
                    <th
                      colSpan={2}
                      className="border px-2 py-1 bg-gray-50 text-center text-xs font-medium"
                    >
                      PM
                    </th>
                  </React.Fragment>
                ))}
              </tr>
              <tr>
                {chunkDates.map((date) => (
                  <React.Fragment key={date}>
                    <th className="border px-2 py-1 bg-gray-50 text-center text-xs font-medium">
                      Hourly
                    </th>
                    <th className="border px-2 py-1 bg-gray-50 text-center text-xs font-medium">
                      Tip
                    </th>
                    <th className="border px-2 py-1 bg-gray-50 text-center text-xs font-medium">
                      Hourly
                    </th>
                    <th className="border px-2 py-1 bg-gray-50 text-center text-xs font-medium">
                      Tip
                    </th>
                  </React.Fragment>
                ))}
              </tr>
            </thead>
            <tbody>
              {employees.map((emp) => (
                <tr key={emp._id}>
                  <td className="border px-3 py-1">{emp.name}</td>
                  <td className="border px-3 py-1">{emp.hourlyPay}</td>
                  {chunkDates.map((date) => (
                    <React.Fragment key={date}>
                      <td className="border px-2 py-1">{/* AM Hourly */}</td>
                      <td className="border px-2 py-1">{/* AM Tip */}</td>
                      <td className="border px-2 py-1">{/* PM Hourly */}</td>
                      <td className="border px-2 py-1">{/* PM Tip */}</td>
                    </React.Fragment>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        ))}
      </div>
    </div>
  );
}
